import React from "react";
import { Grid } from "@material-ui/core";

class ImageCard extends React.Component {
  render() {
    const { description, id, urls } = this.props.image;
    return (
      <Grid item>
        <img
          src={urls.regular}
          alt={description}
          key={id}
          style={{ width: "250px", height: "150px" }}
        />
      </Grid>
    );
  }
}

export default ImageCard;
